import React from 'react'
import { Card } from 'react-bootstrap'
import { Link } from 'react-router-dom';

const Book = (props) => {

    const { id, title, author, publisher, price, created_at } = props.book;
    return (
        <Card>
            <Card.Body>
                <Card.Title>책 제목: {title}</Card.Title>
                <Card.Text>저자: {author}</Card.Text>
                <Card.Text>출판사: {publisher}</Card.Text>
                <Card.Text>출판일: {created_at}</Card.Text>
                <Card.Text>가격: {price}</Card.Text>
                <Link to={`/bookDetail/${id}`}>상세보기</Link>
            </Card.Body>
        </Card>
    )
}


export default Book
